import 'dart:math';

class ArticlesModel {
  dynamic articles;

  ArticlesModel({this.articles});

  factory ArticlesModel.fromJson(dynamic json) {
    List<ArticleModel> arr = json.map((i) => ArticleModel.fromJson(i)).toList();
    return ArticlesModel(articles: arr);
  }
}

